await robot.userRequest('引导服务');
await robot.goto('接待区');
let detectResult = await robot.detectHuman();
if(detectResult){
    await robot.goto('会客厅');
    await robot.speak('已到达会客厅');
}else{
    await robot.goto('充电桩');
}

